import React, { Component } from 'react'
// import logo from '/.logo.svg';
import SlotsAvailable from './components/SlotsAvailable';

class App extends Component {
  render() {
  return (
    <div className="App">
      <pre><SlotsAvailable time ="3:00 pm" noofslots="10 Available slots"/> <SlotsAvailable time ="3:30 pm" noofslots="10 Available slots"/> 
      <SlotsAvailable time ="4:00 pm" noofslots="10 Available slots"/> &nbsp;
      <SlotsAvailable time ="4:30 pm" noofslots="10 Available slots"/></pre>
      </div>

    );
  }
}

export default App;
